import React from "react";



class Display extends React.Component {
	constructor(props) {
		super(props);

		this.state = {
			items: [],
			posts:[],
			comments:[],
			DataisLoaded: false,
            error:null
		};
	}

	componentDidMount() {
		fetch("https://jsonplaceholder.typicode.com/comments")
			.then((res) => res.json())
			.then((json) => {
				this.setState({
					items: json,
					DataisLoaded: true,

				});


			},


            (error) => {
                this.setState({
					DataisLoaded: true,
                  error:error
                });

			})

			fetch("https://jsonplaceholder.typicode.com/users")
			.then((res) => res.json())
			.then((json) => {
				this.setState({
					posts: json,
					DataisLoaded: true,

				});


			},


            (error) => {
                this.setState({
                  DataisLoaded: true,
                  error:error
                });

			})


	}

	render() {
		const {error, DataisLoaded, items } = this.state;

        if(error){
            return <div>Error: {error.message}</div>
        }
		else if (!DataisLoaded)
         return <div>Loading...</div>;

		return (
           <div>
			 <div className="bodyone">
            {items.map(item => (
              <div  key={item.id}>
              <p > PostId : {item.postId}</p>
               <p> Id : {item.id}</p> 
			   <p> Name : {item.name}</p> 
               <p> Email : {item.email}</p> 
			   <p> Body : {item.body}</p> 

              </div>


            ))}

          </div>
		   </div>




	);
}
}

export default Display;


